-- Volcando estructura para procedimiento dbhotelparaperros.actualizarCliente
DELIMITER //
CREATE PROCEDURE `actualizarCliente`(
    IN p_id_cliente INT,
    IN p_nombre VARCHAR(50),
    IN p_apellido VARCHAR(50),
    IN p_direccion VARCHAR(50),
    IN p_telefono VARCHAR(50),
    IN p_usuario VARCHAR(50),
    IN p_clave VARCHAR(64),
    IN p_img_usuario BLOB
)
BEGIN
    IF p_img_usuario IS NOT NULL THEN
        UPDATE tbcliente
        SET nombre = p_nombre,
            apellido = p_apellido,
            direccion = p_direccion,
            telefono = p_telefono,
            usuario = p_usuario,
            clave = SHA2(p_clave, 256),
            img_usuario = p_img_usuario
        WHERE id_cliente = p_id_cliente;
    ELSE
        UPDATE tbcliente
        SET nombre = p_nombre,
            apellido = p_apellido,
            direccion = p_direccion,
            telefono = p_telefono,
            usuario = p_usuario,
            clave = SHA2(p_clave, 256)
        WHERE id_cliente = p_id_cliente;
    END IF;
END//
DELIMITER ;

