-- Volcando estructura para procedimiento dbhotelparaperros.actualizar_salario
DELIMITER //
CREATE PROCEDURE `actualizar_salario`(
	IN `p_id_empleado` INT
)
BEGIN
	DECLARE salario_calculado DECIMAL(10,2);

    -- Calcular el salario total multiplicando las horas por el costo por hora
    SELECT ((tf.salario / 192) * tp.horas) - 33
    INTO salario_calculado
    FROM tbplanilla tp
    INNER JOIN tbfuncion tf ON tp.id_funcion = tf.id_funcion
    WHERE tp.id_empleado = p_id_empleado;

    -- Actualizar el campo 'salario_total' en tbplanilla
    UPDATE tbplanilla
    SET salario_total = salario_calculado
    WHERE id_empleado = p_id_empleado;

END//
DELIMITER ;

