-- Volcando estructura para procedimiento dbhotelparaperros.conteo_dias
DELIMITER //
CREATE PROCEDURE `conteo_dias`(
	IN `p_id_empleado` INT,
	IN `p_fecha2` DATE
)
BEGIN
    -- Declarar variables locales
    DECLARE fecha_inicio DATE;
    DECLARE conteo INT;

    -- Calcular la fecha de inicio (30 días antes de la fecha2)
    SET fecha_inicio = DATE_SUB(p_fecha2, INTERVAL 30 DAY);

    -- Realizar la consulta de conteo de asistencias
    SELECT COUNT(*)
    INTO conteo
    FROM tbasistencia
    WHERE id_empleado = p_id_empleado
      AND fecha_actual BETWEEN fecha_inicio AND p_fecha2;

    -- Intentar actualizar el campo 'dias' en tbplanilla
    UPDATE tbplanilla
    SET dias = conteo
    WHERE id_empleado = p_id_empleado
      AND fecha = p_fecha2;
      
    -- No se realiza ninguna inserción explícita aquí
END//
DELIMITER ;

-- Volcando estructura para procedimiento dbhotelparaperros.conteo_horas
DELIMITER //
CREATE PROCEDURE `conteo_horas`(
	IN `p_id_empleado` INT,
	IN `p_fecha` DATE
)
BEGIN
    -- Declarar variables locales
    DECLARE fecha_inicio DATE;
    DECLARE total_segundos INT;
    DECLARE horas_trabajadas DECIMAL(10,2);

    -- Calcular la fecha de inicio (30 días antes de p_fecha)
    SET fecha_inicio = DATE_SUB(p_fecha, INTERVAL 30 DAY);

    -- Realizar la consulta para sumar los segundos totales
    SELECT SUM(TIMESTAMPDIFF(SECOND, `hora_ingreso`, `hora_salida`))
    INTO total_segundos
    FROM tbasistencia
    WHERE id_empleado = p_id_empleado
      AND fecha_actual BETWEEN fecha_inicio AND p_fecha;

    -- Convertir los segundos totales a horas
    SET horas_trabajadas = total_segundos / 3600; -- 3600 segundos en una hora

    -- Actualizar el campo 'horas' en tbplanilla
    UPDATE tbplanilla
    SET horas = horas_trabajadas
    WHERE id_empleado = p_id_empleado
      AND fecha = p_fecha;
      
    -- No se realiza ninguna inserción explícita aquí
END//
DELIMITER ;

-- Volcando estructura para procedimiento dbhotelparaperros.crearReserva
DELIMITER //
CREATE PROCEDURE `crearReserva`(
    IN p_id_cliente INT,
    IN p_id_mascota INT,
    IN p_id_servicios VARCHAR(255), -- Cadena de IDs de servicios separados por comas
    IN p_monto_total FLOAT,
    IN p_codigo_ticket INT,
    IN p_fecha_inicio DATETIME,
    IN p_estado VARCHAR(50),
    IN p_fecha_fin DATETIME,
    IN p_id_dormitorio INT,
    IN p_proceso VARCHAR(50),
    OUT p_id_reserva INT
)
BEGIN
    DECLARE id_detalle INT;
    DECLARE id_servicio INT;
    DECLARE str_servicio VARCHAR(255);
    DECLARE done INT DEFAULT 0;
    DECLARE splitter CURSOR FOR SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(p_id_servicios, ',', numbers.n), ',', -1) AS servicio_id
                                FROM (SELECT @row := @row + 1 AS n FROM (SELECT 1 UNION SELECT 2 UNION SELECT 3 UNION SELECT 4 UNION SELECT 5 UNION SELECT 6 UNION SELECT 7 UNION SELECT 8 UNION SELECT 9 UNION SELECT 10) numbers, (SELECT @row := 0) r) numbers
                                WHERE n <= LENGTH(p_id_servicios) - LENGTH(REPLACE(p_id_servicios, ',', '')) + 1;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    -- Insertar en detalle de reserva
    INSERT INTO tbdetalle_reserva (id_mascota, monto_total_reserva)
    VALUES (p_id_mascota, p_monto_total);
    SET id_detalle = LAST_INSERT_ID();

    -- Insertar en reserva con la fecha de creación establecida en el momento actual
    INSERT INTO tbreserva (id_cliente, id_detalle_reserva, codigo_ticket, fecha_inicio, estado, fecha_fin, id_dormitorio, proceso, fecha_creacion)
    VALUES (p_id_cliente, id_detalle, p_codigo_ticket, p_fecha_inicio, p_estado, p_fecha_fin, p_id_dormitorio, p_proceso, NOW());
    SET p_id_reserva = LAST_INSERT_ID();

    -- Insertar en reserva_servicio para cada servicio
    OPEN splitter;
    read_loop: LOOP
        FETCH splitter INTO str_servicio;
        IF done THEN
            LEAVE read_loop;
        END IF;
        SET id_servicio = CAST(str_servicio AS UNSIGNED);
        INSERT INTO tbreserva_servicio (id_detalle_reserva, id_servicio)
        VALUES (id_detalle, id_servicio);
    END LOOP;
    CLOSE splitter;

    -- Actualizar la disponibilidad del dormitorio
    UPDATE tbdormitorios
    SET disponibilidad = 0
    WHERE id_dormitorio = p_id_dormitorio;
END//
DELIMITER ;

