-- Volcando estructura para procedimiento dbhotelparaperros.Delegar_Funcion
DELIMITER //
CREATE PROCEDURE `Delegar_Funcion`(
    IN p_id_empleado INT,
    IN p_descripcion VARCHAR(50),
    IN p_inicio_contratacion DATE,
    IN p_salario INT
)
BEGIN
    DECLARE p_id_funcion INT;
    DECLARE p_fecha DATE;
    
    -- Insertar en tbfuncion
    INSERT INTO tbfuncion (id_empleado, descripcion, inicio_contratacion, salario)
    VALUES (p_id_empleado, p_descripcion, p_inicio_contratacion, p_salario);
    
    -- Obtener el id_funcion insertado
    SET p_id_funcion = LAST_INSERT_ID();
    
    -- Calcular la fecha p_inicio_contratacion + 30 días
    SET p_fecha = DATE_ADD(p_inicio_contratacion, INTERVAL 30 DAY);
    
    -- Insertar en tbplanilla
    INSERT INTO tbplanilla (id_empleado, id_funcion, fecha)
    VALUES (p_id_empleado, p_id_funcion, p_fecha);
    
END//
DELIMITER ;

-- Volcando estructura para procedimiento dbhotelparaperros.eliminarReservasPendientes1
DELIMITER //
CREATE PROCEDURE `eliminarReservasPendientes1`()
BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE res_id INT;
    DECLARE dorm_id INT;
    DECLARE cur CURSOR FOR
        SELECT r.id_reserva, r.id_dormitorio
        FROM tbreserva r
        WHERE r.proceso = 'pendiente' 
        AND TIMESTAMPDIFF(MINUTE, r.fecha_creacion, NOW()) > 1;
    
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN cur;

    read_loop: LOOP
        FETCH cur INTO res_id, dorm_id;
        IF done THEN
            LEAVE read_loop;
        END IF;
        
        -- Eliminar la reserva y sus detalles relacionados
        DELETE r, dr, rs
        FROM tbreserva r
        JOIN tbdetalle_reserva dr ON r.id_detalle_reserva = dr.id_detalle_reserva
        LEFT JOIN tbreserva_servicio rs ON dr.id_detalle_reserva = rs.id_detalle_reserva
        WHERE r.id_reserva = res_id;

        -- Liberar el dormitorio correspondiente
        UPDATE tbdormitorios
        SET disponibilidad = 1
        WHERE id_dormitorio = dorm_id;
    END LOOP;

    CLOSE cur;
END//
DELIMITER ;

-- Volcando estructura para evento dbhotelparaperros.evento_eliminar_reservas_pendientes
DELIMITER //
CREATE EVENT `evento_eliminar_reservas_pendientes` ON SCHEDULE EVERY 1 MINUTE STARTS '2024-07-02 19:01:59' ON COMPLETION NOT PRESERVE ENABLE DO CALL eliminarReservasPendientes()//
DELIMITER ;

-- Volcando estructura para procedimiento dbhotelparaperros.liberarDormitorios
DELIMITER //
CREATE PROCEDURE `liberarDormitorios`()
BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE res_id INT;
    DECLARE dorm_id INT;
    DECLARE cur CURSOR FOR
        SELECT r.id_reserva, r.id_dormitorio
        FROM tbreserva r
        WHERE r.fecha_fin <= NOW() AND r.estado = 'pendiente';
    
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN cur;

    read_loop: LOOP
        FETCH cur INTO res_id, dorm_id;
        IF done THEN
            LEAVE read_loop;
        END IF;
        
        -- Actualizar estado de la reserva a 'completada'
        UPDATE tbreserva
        SET estado = 'completada'
        WHERE id_reserva = res_id;

        -- Liberar el dormitorio correspondiente
        UPDATE tbdormitorios
        SET disponibilidad = 1
        WHERE id_dormitorio = dorm_id;
    END LOOP;

    CLOSE cur;
END//
DELIMITER ;

