-- Volcando estructura para procedimiento dbhotelparaperros.listarMascotasDisponiblesPorCliente
DELIMITER //
CREATE PROCEDURE `listarMascotasDisponiblesPorCliente`(
    IN p_id_cliente INT
)
BEGIN
    SELECT m.*
    FROM tbmascota m
    WHERE m.id_cliente = p_id_cliente 
      AND m.id_mascota NOT IN (
          SELECT dr.id_mascota 
          FROM tbdetalle_reserva dr
          JOIN tbreserva r ON dr.id_detalle_reserva = r.id_detalle_reserva
          WHERE r.fecha_fin > NOW()
      );
END//
DELIMITER ;

-- Volcando estructura para procedimiento dbhotelparaperros.listarReservasDetalles
DELIMITER //
CREATE PROCEDURE `listarReservasDetalles`()
BEGIN
    SELECT 
        r.id_reserva,
        r.codigo_ticket,
        m.nombre AS nombre_mascota,
        GROUP_CONCAT(s.descripcion SEPARATOR ', ') AS servicios_contratados,
        SUM(s.precio) AS precio_total,
        d.nombre AS nombre_dormitorio,
        r.proceso
    FROM 
        tbreserva r
        JOIN tbdetalle_reserva dr ON r.id_detalle_reserva = dr.id_detalle_reserva
        JOIN tbmascota m ON dr.id_mascota = m.id_mascota
        JOIN tbreserva_servicio rs ON dr.id_detalle_reserva = rs.id_detalle_reserva
        JOIN tbservicios s ON rs.id_servicio = s.id_servicio
        JOIN tbdormitorios d ON r.id_dormitorio = d.id_dormitorio
    GROUP BY 
        r.id_reserva, r.codigo_ticket, m.nombre, d.nombre, r.proceso;
END//
DELIMITER ;

