-- Volcando estructura para procedimiento dbhotelparaperros.obtenerReservasPorCliente
DELIMITER //
CREATE PROCEDURE `obtenerReservasPorCliente`(IN p_id_cliente INT)
BEGIN
    SELECT 
        r.id_reserva,
        m.nombre AS nombre_mascota,
        GROUP_CONCAT(s.descripcion SEPARATOR ', ') AS servicios_contratados,
        r.fecha_inicio,
        r.fecha_fin,
        dr.monto_total_reserva,
        r.proceso
    FROM 
        tbreserva r
        JOIN tbdetalle_reserva dr ON r.id_detalle_reserva = dr.id_detalle_reserva
        JOIN tbmascota m ON dr.id_mascota = m.id_mascota
        JOIN tbservicios s ON FIND_IN_SET(s.id_servicio, dr.id_servicio)
    WHERE 
        r.id_cliente = p_id_cliente
    GROUP BY 
        r.id_reserva;
END//
DELIMITER ;

