-- Volcando estructura para procedimiento dbhotelparaperros.registrar_asistencia
DELIMITER //
CREATE PROCEDURE `registrar_asistencia`(
	IN `p_id_empleado` INT,
	IN `p_fecha_actual` DATE
)
BEGIN
    DECLARE v_hora_actual TIME;
    
    -- Obtenemos la hora actual del sistema
    SET v_hora_actual = CURTIME();
    
    -- Verificamos si ya existe un registro para el empleado en la fecha actual
    IF NOT EXISTS (
        SELECT 1 FROM tbasistencia
        WHERE id_empleado = p_id_empleado
          AND fecha_actual = p_fecha_actual
    ) THEN
        -- No existe un registro para este empleado y fecha, procedemos a insertar
        INSERT INTO tbasistencia (id_empleado, fecha_actual, hora_ingreso)
        VALUES (p_id_empleado, p_fecha_actual, v_hora_actual);
        
    ELSE
        -- Ya existe un registro para este empleado y fecha, procedemos a actualizar la hora de salida si no está registrada
        UPDATE tbasistencia
        SET hora_salida = v_hora_actual
        WHERE id_empleado = p_id_empleado
          AND fecha_actual = p_fecha_actual
          AND hora_ingreso IS NOT NULL
          AND hora_salida IS NULL; -- Para asegurar que solo actualice si no hay hora de salida registrada
        
    END IF;
    
    -- Puedes agregar más lógica aquí si es necesario
    
END//
DELIMITER ;

-- Volcando estructura para procedimiento dbhotelparaperros.registrar_pago_y_actualizar_reserva
DELIMITER //
CREATE PROCEDURE `registrar_pago_y_actualizar_reserva`(
    IN `p_id_empleado` INT,
    IN `p_id_reserva` INT,
    IN `p_fecha_pago` DATE,
    IN `p_monto` DOUBLE
)
BEGIN
    -- Insertar el pago en la tabla tbpago
    INSERT INTO tbpago (id_empleado, id_reserva, fecha_pago, monto)
    VALUES (p_id_empleado, p_id_reserva, p_fecha_pago, p_monto);

    -- Actualizar el proceso de la reserva a 'Pagado'
    UPDATE tbreserva
    SET proceso = 'Pagado'
    WHERE id_reserva = p_id_reserva;
END//
DELIMITER ;

