-- Volcando estructura para disparador dbhotelparaperros.actualizar_stock
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_ZERO_IN_DATE,NO_ZERO_DATE,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `actualizar_stock` AFTER INSERT ON `tbkardex` FOR EACH ROW BEGIN
    DECLARE cantidad_movimiento INT;
    
    -- Obtener la cantidad del movimiento según el tipo
    IF NEW.tipo_movimiento = 'entrada' THEN
        SET cantidad_movimiento = NEW.cantidad;
    ELSEIF NEW.tipo_movimiento = 'salida' THEN
        SET cantidad_movimiento = -NEW.cantidad;
    ELSE
        -- Manejar otros tipos de movimiento si es necesario
        SET cantidad_movimiento = 0;
    END IF;
    
    -- Actualizar el stock en tbinventario
    UPDATE tbinventario
    SET stock = stock + cantidad_movimiento
    WHERE id_inventario = NEW.id_inventario;
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

-- Volcando estructura para disparador dbhotelparaperros.after_insert_tbarticulo
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_ZERO_IN_DATE,NO_ZERO_DATE,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `after_insert_tbarticulo` AFTER INSERT ON `tbarticulo` FOR EACH ROW BEGIN
    INSERT INTO tbinventario (id_articulo, id_empleado, stock)
    VALUES (NEW.id_articulo, NEW.id_empleado, 0);
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

